          "id": "c10c2b53a34f11f4548dcdc2979633325d57696d",
          "message": "Add `embed_metdata` build option to reduce build times (#2166)\n\n# Introduction\r\nAs of right now, a standard Risc0 build consists of three components:\r\n1. Build the guest `elf` with a recursive `cargo build` invocation\r\n2. Compute the ImageID of the guest elf\r\n3. Generate a Rust package exporting the ImageID and elf `const\r\nMETHOD_ELF: &[u8] = ...`.\r\n\r\nThis PR adds \"light\" builds - an opt-in mechanism to skip steps 2 and 3.\r\nThis drastically reduces the incremental build time, making it much more\r\nfeasible to compile Risc0 applications as part of the development loop.\r\nUnlike the naive strategy of skipping Risc0 compilation, `light` builds\r\nstill allow detection of compilation issues in the guest binaries - and\r\neven proof generation - without waiting on a full build cycle.\r\n\r\n## Performance\r\n\r\nThe timings in this section were generated by compiling the Sovereign\r\nSDK demo-rollup. This rollup builds two guest `elf` files, each one of\r\nwhich is about 20MB in size. All timings shown come from hot incremental\r\nbuilds - meaning that each command was invoked twice in succession and\r\nonly the second output is shown below.\r\n\r\n### No Guest Build\r\nSkipping the `risc0_build` invocation entirely, a hot incremental build\r\nof the rollup takes 1 second:\r\n```\r\n~/Developer/sovereign/v1/sovereign-sdk$ time SKIP_GUEST_BUILD=1 cargo check                  \r\n   Compiling sov-module-schemas v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/crates/module-system/module-schemas)\r\n    Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.97s\r\nSKIP_GUEST_BUILD=1 cargo check  0.40s user 0.24s system 60% cpu 1.062 total\r\n```\r\n\r\nNote: In this configuration the guest binary is not built at all - so\r\nany issues in the guest code are undetectable.\r\n\r\n### Light Build\r\nUsing the light build (skipping steps 2-3) an incremental build takes\r\n2-3 seconds:\r\n```\r\n~/Developer/sovereign/v1/sovereign-sdk$ time cargo check                   \r\n   Compiling risc0 v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/examples/demo-rollup/provers/risc0)\r\n   Compiling sov-module-schemas v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/crates/module-system/module-schemas)\r\nsov-demo-prover-guest-celestia: Starting build for riscv32im-risc0-zkvm-elf, risc0(build)                                                      \r\nsov-demo-prover-guest-celestia:     Finished `release` profile [optimized + debuginfo] target(s) in 0.27s\r\nsov-demo-prover-guest-mock: Starting build for riscv32im-risc0-zkvm-elfisc0(build)                                                             \r\nsov-demo-prover-guest-mock:     Finished `release` profile [optimized + debuginfo] target(s) in 0.24s                                          \r\nFinished risc0 build script in 691 ms\r\n    Checking sov-demo-rollup v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/examples/demo-rollup)\r\n    Finished `dev` profile [unoptimized + debuginfo] target(s) in 1.93s\r\ncargo check  1.25s user 0.75s system 98% cpu 2.026 total\r\n```\r\n\r\n### Standard Build\r\nRunning an incremental build with the standard setup\r\n(`embed_methods_with_options`) takes between 30 and 60 seconds,\r\ndepending on the run.\r\n```\r\n~/Developer/sovereign/v1/sovereign-sdk$ time cargo check\r\n   Compiling risc0 v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/examples/demo-rollup/provers/risc0)\r\n   Compiling sov-module-schemas v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/crates/module-system/module-schemas)\r\nsov-demo-prover-guest-celestia: Starting build for riscv32im-risc0-zkvm-elfschemas(build)                                                      \r\nsov-demo-prover-guest-celestia:     Finished `release` profile [optimized + debuginfo] target(s) in 0.44s                                      \r\nsov-demo-prover-guest-mock: Starting build for riscv32im-risc0-zkvm-elf\r\nsov-demo-prover-guest-mock:     Finished `release` profile [optimized + debuginfo] target(s) in 0.26s\r\nFinished risc0 build script in 6080 ms \r\n    Checking sov-demo-rollup v0.3.0 (/Users/prestonevans/Developer/sovereign/v1/sovereign-sdk/examples/demo-rollup)\r\n    Finished `dev` profile [unoptimized + debuginfo] target(s) in 32.25s\r\ncargo check  23.03s user 4.84s system 86% cpu 32.390 total\r\n```\r\n\r\n## Analysis\r\nAs you can see in the timings, the vast majority of the total build time\r\nis spent outside of the build script. In other words, invoking cargo to\r\nrebuild the guest binaries is not the bottleneck! Based on the simple\r\ntiming information available here, it looks like...\r\n- Invoking cargo recursively accounts for about 3% of the total work\r\n- Computing image IDs is about 15% of the total\r\n- Compiling/linking the `\"methods.rs\"` file accounts for the ~80% of the\r\ntotal build time.\r\n\r\nGiven this data, I'd propose adding a method to opt-out of ImageID and\r\ngeneration of the `const METHOD_ELF`. The prototype in this PR shows how\r\nsuch functionality can be implemented.\r\n\r\n---------\r\n\r\nCo-authored-by: Frank Laub <flaub@risc0.com>\r\nCo-authored-by: Erik Kaneda <erik@risczero.com>",
