          "id": "bdaf567a2468f6fc16ad14c4b847c058dd82e04c",
          "message": "Validate Poseidon `hash_pair` input (#1372)\n\nOur Poseidon/Poseidon2 `hash_pair` functionality is intended to work\r\nwith Digests generated by Poseidon hashing. However, prior to this PR,\r\nit does not perform checking to ensure that its input Digests are in\r\nthis format. This means a developer unaware of this nuance might\r\naccidentally write code that expects these `hash_pair` functions to work\r\nas hash functions on general Digests with values outside those possible\r\nfrom Poseidon hashing, which could create a vulnerability depending on\r\nthe use case.\r\n\r\nThis PR adds an `assert` that validates all inputs are in the required\r\nformat by adding the ability to test that words in a Digest are elements\r\nof the underlying field in reduced form. Thus, any developer misusing\r\n`hash_pair` in the above way would hit this `assert` instead of running\r\nto completion and producing a \"hash\" that does not have all the security\r\nproperties such a developer might expect.\r\n\r\n---------\r\n\r\nCo-authored-by: Victor Graf <victor@risczero.com>\r\nCo-authored-by: Frank Laub <flaub@risc0.com>",
